    static Set<Integer> primeSet = new HashSet<>();

    public int sumFourDivisors(int[] nums) {
        for(int prime : primes) {
            primeSet.add(prime);
        }
        int ans = 0;
        for (int num : nums) {
            int tmp = fourDivisor(num);
            if(tmp != 0) {
                if(countDivisors(num) != 4) {
                    System.out.println(num +"\t" + fourDivisor(num)+ "\t" + countDivisors(num));
                }
            }
            ans += tmp;
        }
        return ans;
    }

    private int fourDivisor(int num) {
        if(num == 1) {
            return 0;
        }
        if(Math.sqrt(num) % 1 == 0) {
            return 0;
        }
        if(Math.cbrt(num) % 1 == 0) {
            int cbrt = (int) Math.cbrt(num);
            if(primeSet.contains(cbrt)) {
                return 1 + num + cbrt +  cbrt * cbrt;
            } else {
                return 0;
            }
        }

        for(int i = 0; i < primes.length; i++) {
            if(num%primes[i] == 0) {
                int div = num/ primes[i];
                if(primeSet.contains(div)) {
                    return 1 + num + div + primes[i];
                } else {
                    break;
                }
            }
        }
        return 0;
    }

    private int countDivisors(int num) {
        int count = 0;
        for(int i = 1; i <= num; i++) {
            if(num % i == 0) {
                count ++;
            }
        }
        return count;
    }

